import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'estacionamento';

  import { getGarage } from './garage';

  const $ = (q: string): HTMLElement => document.querySelector(q);

  function convertPeriod(mil: number): string {
      const min = Math.floor(mil / 60000);
      const sec = Math.floor((mil % 60000) / 1000);
      return `${min}m e ${sec}s`;
  }

  function renderGarage(): void {
      const garage = getGarage();
      $("#garage").innerHTML = "";
      garage.forEach((c) => addCarToGarage(c));
  }

  function addCarToGarage(car: { name: string; licence: string; time: string }): void {
      const row = document.createElement("tr");
      row.innerHTML = `
          <td>${car.name}</td>
          <td>${car.licence}</td>
          <td data-time="${car.time}">
              ${new Date(car.time).toLocaleString("pt-BR", {
                  hour: "numeric",
                  minute: "numeric",
              })}
          </td>
          <td>
              <button class="delete">x</button>
          </td>
      `;
      $("#garage").appendChild(row);
  }

  function checkOut(info: NodeListOf<HTMLTableDataCellElement>): void {
      let period = new Date().getTime() - new Date(info[2].dataset.time).getTime();
      period = convertPeriod(period);
      const licence = info[1].textContent;
      const msg = `O veículo ${info[0].textContent} de placa ${licence} permaneceu ${period} estacionado. \n\n Deseja encerrar?`;
      if (!confirm(msg)) return;
      const garage = getGarage().filter((c) => c.licence !== licence);
      localStorage.garage = JSON.stringify(garage);
      renderGarage();
  }

  export { renderGarage, addCarToGarage, checkOut };
  const getGarage = (): { name: string, licence: string, time: Date }[] => localStorage.garage ? JSON.parse(localStorage.garage) : [];
renderGarage();

document.querySelector("#send").addEventListener("click", e => {
    const name = (<HTMLInputElement>document.querySelector("#name")).value;
    const licence = (<HTMLInputElement>document.querySelector("#licence")).value;
    if(!name || !licence){
        alert("Os campos são obrigatórios.");
        return;
    }   
    const card = { name, licence, time: new Date() };
    const garage = getGarage();
    garage.push(card);
    localStorage.garage = JSON.stringify(garage);
    addCarToGarage(card);
    (<HTMLInputElement>document.querySelector("#name")).value = "";
    (<HTMLInputElement>document.querySelector("#licence")).value = "";
});

document.querySelector("#garage").addEventListener("click", (e) => {
    if((<HTMLElement>e.target).className === "delete")
        checkOut((<HTMLTableRowElement>e.target.parentElement.parentElement).cells);
});

}
